col = (0,0,0)
def startLiving(screen, array):
    nxt=np.zeros((array.shape[0], array.shape[1]))

    for r,c in np.ndindex(array.shape):
        num_alive= np.sum(array[r-1:r+2, c-1:c+2])-array[r,c]

        if array[r,c]==1 and num_alive <2 or num_alive > 3:
            global col
            col=(55,55,30)
        elif(array[r,c]==1 and 2<=num_alive <= 3) or (array[r,c]==0 and num_alive==3):
            nxt[r,c]=1
            col1 = col
            col = changecolor(col1)

            col=col if array[r,c]==1 else (245,245,245)
            pygame.draw.rect(screen,col,(5 * c ,5 * r ,4 ,4))
    return nxt

def changecolor(colAlive):
    y=list(colAlive)
    for i in range(len(y)):
        num=randint(-10,10)
        if(10< num < 245):
            i=num+i

    colAlive = tuple(y)

    return colAlive
    

def main():
    pygame.init()
    pygame.display.set_caption("game of life")
    clock = pygame.time.Clock()
    screen = pygame.display.set_mode((600,450))
    cells = setup()
 

    while(True):
        for event in pygame.event.get():
            if (event.type==QUIT):
                pygame.quit()
                sys.exit()

        screen.fill((255,255,255))
        cells=startLiving(screen,cells)
        clock.tick(15)
        pygame.display.update()

main()

